Based on the comment the OP made above, they are looking for weeks up to the finish date. Rather than doing this with a loop, it can much more easily (and efficiently) be achieved with a rCTE:
DECLARE @FinishDate datetime = '20171231', @StartDate datetime = '20171204'; DECLARE @EndDate datetime = DATEADD(DAY, 6, @StartDate); WITH Dates AS ( SELECT @StartDate AS StartDate, @EndDate AS EndDate UNION ALL SELECT DATEADD(DAY, 7,StartDate), DATEADD(DAY, 7,EndDate) FROM Dates WHERE DATEADD(DAY, 7,EndDate) <= @FinishDate) SELECT * FROM Dates;
This gives you all the weeks in December 2017.

